Information
------------------------------

Wars are conflicts between states and societies. Soldiers are the human means through which wars are fought. Soldiers, the major BBC series on the history of warfare, tells its story through the different types of soldiers who have fought each other since warfare began.
&quot;War changes men and it changes Man; it alters our world and our history, our political systems, our social attitudes, our perceptions and our moralities. By showing how men go into it, pass through it and emerge from it, 'Soldiers' tells us something we need to know.&quot; - Frederick Forsyth

A BBC-TV Production in association with RKO Pictures New York and ABC Australia

11)  Irregular 
The irregular appears in many guises. He may be a peasant or townsman, or even a specially trained member of a regular army, using the irregular tactics of subversion, ambush, demolitions and dirty tricks. The history of the irregular forces including guerillas and the special army units formed to combat them.

